    false,nt"url": null,nt"notes": "This annual narrative report for Potomac
    River National Wildlife Refuge Complex outlines Refuge accomplishments during the
    1983 calendar year. The report begins with a summary of the year's highlights and
    weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses research and investigations. Refuge administration is outlined;
    information about personnel, youth programs, volunteer programs, and safety is given.
    Habitat management is also covered; subjects include wetlands, forests, and grasslands.
    The wildlife section of the report discusses wildlife diversity, endangered and
    threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, and marking and bird banding. The public uses of the Refuge described
    in this report include outdoor classrooms, interpretive programs, wildlife observation,
    outdoor recreation, and law enforcement. The equipment and facilities section of
    the report provides information about rehabilitation. Items of interest are provided
    at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
